				stage.addChildAt(ball, stick.length + 2); //שימוש בפונקציה המוסיפה את האלמנטים לפי גובה השכבה מאפשרת יצירת בועה שהיא עליונה לשאר האלמנטים שמוצבים על הבמה
				//בדיקה האם האובייקט הוא תמונה או שם של מדינה
