		function intersect(obj1, obj2) {
			var obj1W = obj1.nominalBounds;
			var obj2W = obj2.nominalBounds;
		
			if (obj1.x + (obj1W.width / 3) <= obj2.x - (obj2W.width / 3)) {
				return false;
			} else if (obj1.y + (obj1W.height / 3) <= obj2.y - (obj2W.height / 3)) {
				return false;
			} else if (obj1.x - (obj1W.width / 3) > obj2.x + (obj2W.width / 3)) {
				return false;
			} else if (obj1.y - (obj1W.height / 3) > obj2.y + (obj2W.height / 3)) {
				return false;
			}
			return true;
		}
		
		
